offers.description:
Автомобиль в отличном состоянии, все расходники всегда своевременно заменялись.
Комплектация:
- кондиционер;
- мультируль;
- передние стеклоподъемники;
- ABS;
- ESP;
- ДХО;
- Круиз-контроль;
- Система помощи при трогании в гору (HSA);
- подогрев передних сидений, лобового и заднего стекла + зеркал заднего вида;
- сигнализация с автозапуском.
Ухоженный салон, не прокурен. Литые диски R16, резина Hankook Kinergy GT H436(2019), Goodyear UltraGrip Ice+ 205/55R16 91T(2020).

 Пройдено ТО и заменено следующее:
- ГРМ, натяжной;
- Ремень генератора;
- Тормозные диски, тормозные колодки(в круг, G brake);
- Охлаждающая жидкость, масло в МКПП.
